	(72, 2539, 'UFO-The Clothing Store', 'UFO is committed to bring stylish and quality fashion at an affordable price to its customers.\r\nU.F.O. The Clothing Store had a humble beginning with a single store established in February 1996 in Ranjana, Kathmandu. The first store opened with an exclusive collection of stylish clothes and shoes for youngsters. Since then it has grown to be a leading clothing chain in Nepal. The continued success of U.F.O.s unique and innovative shopping concept has provided the company with an outstanding record of achievement in a comparatively short period of time.', '10:00:00', '20:00:00', '9847025431', '2147483647', 'info@ufonepal.com', 'www.ufonepal.com', 'yes', 12, '2017-09-03 12:23:32', '2017-09-03 12:23:32'),
